import React from "react";

function Navbar() {
  return (
    <nav className="">
      <ul className="flex flex-row">
        <li className="flex flex-row">Home</li>
        <li className="flex flex-row">Github</li>
        <li className="flex flex-row">LinkedIn</li>
        <li className="flex flex-row">Twitter</li>
        <li className="flex flex-row">Contact</li>
      </ul>
    </nav>
  );
}

export default Navbar;
